function HeroComponent() {
  return (
    <div className="hero-section">
            <h1>Publication</h1>
            <h3>By Students, For Students!</h3>
            <p>We welcome well-researched articles, insightful reviews, and thought-provoking essays that demonstrate curiosity, creativity, and critical thinking in the field of neuroscience. Selected submissions will be showcased to inspire and inform a community of young minds passionate about brain science.</p>
    </div>
  );
}

export default HeroComponent;
